import React from 'react';
import { motion } from "framer-motion";
import Nav from '../Nav'
import ListCabins from './ListCabins';
import {pageTransition} from '../../constants/constants'

export default function Cabins (props) {
    return (
        <motion.div 
            initial={{opacity: 0}} 
            animate={{opacity: 1}}
            exit={{opacity: 0}}>
            <Nav />
            <ListCabins />
        </motion.div>
    )   
}
